// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;


contract Challenge1Factory  {
    event ContractCreated(address contractAddress);
    address public myContractAddress;

    function createContract() public{
        Challenge1 newContract = new Challenge1();
        emit ContractCreated(address(newContract));
        myContractAddress = address(newContract);
    }

    function getContractAddress() public view returns(address){
        return myContractAddress;
    }
}

contract Challenge1 {

    address public me;
    mapping(address => uint256) balances;

    constructor()  payable {
        me = msg.sender;
    }

    function initWallet() external {
        me = payable(msg.sender);
    }

    function deposit() external payable {
        balances[msg.sender] += msg.value;
    }

    function withdraw(uint256 amount) public {
        require(amount <= balances[msg.sender]);
        payable(msg.sender).transfer(amount);
        balances[msg.sender] -= amount;
    }

    function migrateTo(address to) public {
        require(msg.sender == me, "Only me can withdraw all the funds");
        payable(to).transfer(address(this).balance);
    }

    function getBalance() public view returns (uint) 
    {
        return (address(this).balance);
    }

}
